import React, {useState} from'react';

function AlbumList(){
    const [albums, setAlbums] = useState([
        {
            id: 1,
            title: 'Album 1'
        },
        {
            id: 2,
            title: 'Album 2'
        },
        {
            id: 3,
            title: 'Album 3'
        }
    ]);

    return (
        <div>
            <h1>Albums</h1>
            <ul>
                {albums.map(album => (
                    <li key={album.id}>{album.title}</li>
                ))}
            </ul>
        </div>
    );
}

export default AlbumList;
